import React, { useState, useEffect } from "react";
import confetti from "canvas-confetti";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import "./App.css";

const App = () => {
  const [goals, setGoals] = useState(() => {
    const stored = localStorage.getItem("goals");
    return stored ? JSON.parse(stored) : [];
  });
  const [goalText, setGoalText] = useState("");
  const [target, setTarget] = useState(1);
  const [level, setLevel] = useState("beginner");
  const [reward, setReward] = useState("immediate");
  const [filter, setFilter] = useState("all");
  const [sortOrder, setSortOrder] = useState("default");
  const [editingGoalId, setEditingGoalId] = useState(null);

  useEffect(() => {
    localStorage.setItem("goals", JSON.stringify(goals));
  }, [goals]);

  const addGoal = () => {
    if (!goalText || target <= 0) return;
    const baseIncrement = level === "expert" ? 2 : 1;

    if (editingGoalId !== null) {
      setGoals(
        goals.map((g) =>
          g.id === editingGoalId
            ? {
                ...g,
                text: goalText,
                target: parseInt(target),
                level,
                reward,
                increment: baseIncrement,
              }
            : g
        )
      );
      setEditingGoalId(null);
    } else {
      setGoals([
        ...goals,
        {
          id: Date.now(),
          text: goalText,
          progress: 0,
          target: parseInt(target),
          level,
          reward,
          increment: baseIncrement,
        },
      ]);
    }

    setGoalText("");
    setTarget(1);
    setLevel("beginner");
    setReward("immediate");
  };

  const startEditing = (goal) => {
    setGoalText(goal.text);
    setTarget(goal.target);
    setLevel(goal.level);
    setReward(goal.reward);
    setEditingGoalId(goal.id);
  };

  const updateProgress = (id, delta) => {
    setGoals(
      goals.map((g) => {
        if (g.id === id) {
          const newProgress = Math.min(
            g.progress + delta * g.increment,
            g.target
          );
          if (
            g.progress < g.target &&
            newProgress >= g.target &&
            g.reward === "immediate"
          ) {
            confetti();
          }
          return { ...g, progress: newProgress };
        }
        return g;
      })
    );
  };

  const deleteGoal = (id) => setGoals(goals.filter((g) => g.id !== id));
  const totalGoals = goals.length;
  const completedGoals = goals.filter((g) => g.progress >= g.target).length;

  let filteredGoals =
    filter === "all"
      ? goals
      : filter === "completed"
      ? goals.filter((g) => g.progress >= g.target)
      : goals.filter((g) => g.progress < g.target);

  if (sortOrder === "progress") {
    filteredGoals = [...filteredGoals].sort((a, b) => b.progress - a.progress);
  } else if (sortOrder === "target") {
    filteredGoals = [...filteredGoals].sort((a, b) => a.target - b.target);
  }

  // Data for Recharts
  const chartData = goals
    .filter((g) => g.reward === "delayed")
    .map((g) => ({ name: g.text, Progress: g.progress, Target: g.target }));

  return (
    <div className="container">
      <div className="cardContainer">
        <h1 className="title">ðŸŽ¯ Goal Tracker</h1>

        <div className="tabs">
          {["all", "active", "completed", "analysis"].map((tab) => (
            <button
              key={tab}
              onClick={() => setFilter(tab)}
              className={`tab ${filter === tab ? "active" : ""}`}
            >
              {tab.charAt(0).toUpperCase() + tab.slice(1)}
            </button>
          ))}
        </div>

        {filter === "analysis" && chartData.length > 0 && (
          <div className="chartContainer">
            <h2 className="title">Delayed Reward Progress</h2>
            <ResponsiveContainer>
              <BarChart data={chartData}>
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="Progress" fill="#4ade80" />
                <Bar dataKey="Target" fill="#f87171" />
              </BarChart>
            </ResponsiveContainer>
          </div>
        )}

        <div className="inputGroup">
          <input
            className="input"
            type="text"
            placeholder="New goal..."
            value={goalText}
            onChange={(e) => setGoalText(e.target.value)}
          />
          <div className="inputRow">
            <input
              className="input"
              type="number"
              min="1"
              value={target}
              onChange={(e) => setTarget(e.target.value)}
            />
            <select
              className="select"
              value={level}
              onChange={(e) => setLevel(e.target.value)}
            >
              <option value="beginner">Beginner</option>
              <option value="expert">Expert</option>
            </select>
            <select
              className="select"
              value={reward}
              onChange={(e) => setReward(e.target.value)}
            >
              <option value="immediate">Immediate Reward</option>
              <option value="delayed">Delayed Reward</option>
            </select>
            <button className="btnPrimary" onClick={addGoal}>
              {editingGoalId ? "Update" : "Add"}
            </button>
          </div>
        </div>

        <div className="summary">
          Goals Completed: {completedGoals} / {totalGoals}
        </div>

        <div className="goalList">
          {filteredGoals.length === 0 ? (
            <p>No goals found.</p>
          ) : (
            filteredGoals.map((g) => (
              <div
                key={g.id}
                className={`goalCard ${
                  g.progress >= g.target ? "completed" : ""
                }`}
              >
                <div className="goalHeader">
                  <div>
                    <div className="goalText">{g.text}</div>
                    <div className="goalMeta">
                      Level: {g.level} | Reward: {g.reward}
                    </div>
                  </div>
                  <div>
                    <button className="btn" onClick={() => startEditing(g)}>
                      Edit
                    </button>
                    <button className="btn" onClick={() => deleteGoal(g.id)}>
                      Delete
                    </button>
                  </div>
                </div>
                <div className="progressBarContainer">
                  <div
                    className="progressBar"
                    style={{ width: `${(g.progress / g.target) * 100}%` }}
                  />
                </div>
                <div className="goalFooter">
                  <span>
                    {g.progress} / {g.target}
                  </span>
                  <>
                    <button
                      className="btnIncrement"
                      onClick={() => updateProgress(g.id, 1)}
                    >
                      +{g.increment}
                    </button>
                    <button
                      className="btnDecrement"
                      onClick={() => updateProgress(g.id, -1)}
                    >
                      -{g.increment}
                    </button>
                  </>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
};

export default App;
